// Component
import Header from '../components/Header';

import img1 from '../public/experience1.jpg';

const Home = () => {
	return (
		<>
			<Header />
			<div className='max-w-layout mx-auto bg-blue-400'>
				<h3 className='text-xl font-medium py-3 mt-3'>Explore Airbnb</h3>
				<div className='flex flex-wrap items-center justify-start w-full'>
					<div className='flex flex-wrap items-center justify-start py-3 w-1/3 bg-white'>
						<img src={img1} style={{ width: 120, height: 100 }} alt='' />
						<p>Stays</p>
					</div>
				</div>
			</div>
		</>
	);
};

export default Home;
